
import streamlit as st, pandas as pd, numpy as np, matplotlib.pyplot as plt, seaborn as sns, plotly.express as px
from sklearn.model_selection import train_test_split
from sklearn.preprocessing import MinMaxScaler
from sklearn.cluster import KMeans
from sklearn.metrics import silhouette_score, confusion_matrix, f1_score, roc_curve, auc, r2_score, mean_squared_error
from sklearn.neighbors import KNeighborsClassifier
from sklearn.tree import DecisionTreeClassifier, DecisionTreeRegressor
from sklearn.ensemble import RandomForestClassifier, GradientBoostingClassifier
from sklearn.linear_model import LinearRegression
from mlxtend.frequent_patterns import apriori, association_rules

st.set_page_config(page_title="VaporIQ v5", layout="wide")
with open("style.css") as f:
    st.markdown(f"<style>{{f.read()}}</style>", unsafe_allow_html=True)
st.markdown('<div class="smoke-layer"></div>', unsafe_allow_html=True)
st.markdown('<div class="smoke-layer-2"></div>', unsafe_allow_html=True)
st.markdown("<img src='data:image/png;base64,' style='position:fixed;bottom:15px;right:15px;width:110px;opacity:0.8;z-index:1;'/>", unsafe_allow_html=True)

@st.cache_data
def load_data():
    return pd.read_csv("users_synthetic.csv"), pd.read_csv("flavor_trends.csv")
users_df, trends_df = load_data()
core_features = ["Age","SweetLike","MentholLike","PodsPerWeek"]

viz, tasti, forecast, rules_tab = st.tabs(["Data Visualization","TasteDNA","Forecasting","Micro‑Batch & Drops"])

# ============= Viz Tab =================
with viz:
    st.header("📊 Data Visualization Explorer")
    genders = st.sidebar.multiselect("Gender", users_df["Gender"].unique().tolist(), default=list(users_df["Gender"].unique()))
    chans = st.sidebar.multiselect("PurchaseChannel", users_df["PurchaseChannel"].unique().tolist(), default=list(users_df["PurchaseChannel"].unique()))
    df = users_df[users_df["Gender"].isin(genders) & users_df["PurchaseChannel"].isin(chans)]

    col1,col2 = st.columns(2)
    with col1:
        sns.violinplot(data=df, y="Age", inner="box")
        st.pyplot(plt.gcf()); plt.clf()
    with col2:
        sns.scatterplot(data=df, x="Age", y="PodsPerWeek")
        st.pyplot(plt.gcf()); plt.clf()

    sns.heatmap(df[["Age","SweetLike","MentholLike","PodsPerWeek"]].corr(), annot=True, cmap="coolwarm")
    st.pyplot(plt.gcf()); plt.clf()

    flat = df["FlavourFamilies"].str.get_dummies(sep=",").sum().sort_values(ascending=False)
    st.bar_chart(flat)

    top3 = trends_df.drop(columns=["Date"]).mean().sort_values(ascending=False).head(3).index
    st.plotly_chart(px.line(trends_df, x="Date", y=top3, title="Top 3 Flavour Trends"), use_container_width=True)

    sns.boxplot(data=df, x="PurchaseChannel", y="PodsPerWeek")
    st.pyplot(plt.gcf()); plt.clf()

    st.plotly_chart(px.bar(pd.crosstab(df["Gender"], df["SubscribeIntent"]), barmode="stack"), use_container_width=True)

    sns.rugplot(df["SweetLike"], height=.1, color="g"); sns.rugplot(df["MentholLike"], height=.1, color="r")
    st.pyplot(plt.gcf()); plt.clf()

    if "Cluster" not in users_df.columns:
        users_df["Cluster"] = KMeans(4, random_state=42, n_init='auto').fit_predict(MinMaxScaler().fit_transform(users_df[core_features]))
    tmp = users_df.assign(main_flavour=users_df["FlavourFamilies"].str.split(",").str[0])
    st.plotly_chart(px.treemap(tmp, path=["Cluster","main_flavour"], values="PodsPerWeek"))

    ck = trends_df.copy(); ck["cum"]=ck["Custard Kunafa"].cumsum()
    st.plotly_chart(px.area(ck, x="Date", y="cum"), use_container_width=True)

    with st.expander("Key Insights"):
        retail_mean = df[df["PurchaseChannel"]=="Retail"]["PodsPerWeek"].mean()
        online_mean = df[df["PurchaseChannel"]=="Online"]["PodsPerWeek"].mean()
        st.markdown(f"- Retail users avg **{{retail_mean:.1f}}** pods/week vs **{{online_mean:.1f}}** for Online.")
        st.markdown("- Synthetic survey (1200 users) + simulated flavour-trend scrape (120 weeks). Core metrics: mean, corr, slope.")

# ============= TasteDNA Tab =============
with tasti:
    st.header("🔮 TasteDNA Analysis")
    mode = st.radio("Mode", ["Classification","Clustering"], horizontal=True)
    if mode=="Classification":
        clf = st.selectbox("Classifier", ["KNN","Decision Tree","Random Forest","Gradient Boost"])
        X,y = users_df[core_features], users_df["SubscribeIntent"]
        X_tr,X_te,y_tr,y_te = train_test_split(X,y,test_size=0.25,stratify=y,random_state=42)
        model = {{"KNN":KNeighborsClassifier(5),
                  "Decision Tree":DecisionTreeClassifier(max_depth=6,random_state=42),
                  "Random Forest":RandomForestClassifier(n_estimators=200,random_state=42),
                  "Gradient Boost":GradientBoostingClassifier(random_state=42)}}[clf]
        model.fit(X_tr,y_tr); y_pred=model.predict(X_te)
        f1=f1_score(y_te,y_pred); st.metric("F1", f"{{f1:.3f}}")
        cm=confusion_matrix(y_te,y_pred); sns.heatmap(cm,annot=True,fmt="d"); st.pyplot(plt.gcf()); plt.clf()
        prob=model.predict_proba(X_te)[:,1]; fpr,tpr,_=roc_curve(y_te,prob)
        plt.plot(fpr,tpr); plt.plot([0,1],[0,1],'k--'); st.pyplot(plt.gcf()); plt.clf()
        with st.expander("Key Insights"):
            churn = (prob>0.5).mean()*100
            st.markdown(f"- F1 **{{f1:.2f}}**, churn‑risk prob>0.5 ≈ **{{churn:.1f}}%**.")
            st.markdown("- Metrics: F1, ROC‑AUC.")
    else:
        k = st.slider("k clusters",2,10,4)
        scaler = MinMaxScaler(); X_scaled=scaler.fit_transform(users_df[core_features])
        km = KMeans(k,random_state=42,n_init='auto').fit(X_scaled)
        users_df["Cluster"]=km.labels_
        inertias=[KMeans(i,random_state=42,n_init='auto').fit(X_scaled).inertia_ for i in range(2,11)]
        plt.plot(range(2,11), inertias,"o-"); st.pyplot(plt.gcf()); plt.clf()
        sil=silhouette_score(X_scaled, km.labels_); st.metric("Silhouette", f"{{sil:.3f}}")
        st.dataframe(users_df.groupby("Cluster")[core_features].mean().round(2))
        with st.expander("Key Insights"):
            st.markdown(f"- k={{k}}, silhouette **{{sil:.2f}}**; clusters saved for Apriori.") 

# ============= Forecast Tab =============
with forecast:
    st.header("📈 Forecasting")
    flavor = st.selectbox("Flavor signal", trends_df.columns[1:])
    X = np.arange(len(trends_df)).reshape(-1,1); y = trends_df[flavor].values
    split=int(0.8*len(X)); model=LinearRegression().fit(X[:split],y[:split])
    pred=model.predict(X[split:]); r2=r2_score(y[split:],pred); rmse=np.sqrt(mean_squared_error(y[split:],pred))
    st.metric("R²", f"{{r2:.3f}}"); st.metric("RMSE", f"{{rmse:.2f}}")
    plt.scatter(y[split:],pred); plt.plot([y.min(),y.max()],[y.min(),y.max()],'k--'); st.pyplot(plt.gcf()); plt.clf()
    with st.expander("Key Insights"):
        slopes={{c: np.polyfit(np.arange(len(trends_df)), trends_df[c],1)[0] for c in trends_df.columns[1:]}}
        top=max(slopes,key=slopes.get)
        st.markdown(f"- Steepest trend: **{{top}}**.")
        st.markdown(f"- Current model R² **{{r2:.2f}}**.")

# ============= Micro‑Batch Tab ===========
with rules_tab:
    st.header("🧩 Apriori Explorer")
    sup=st.slider("Support",0.01,0.4,0.05,0.01); conf=st.slider("Confidence",0.05,1.0,0.3,0.05)
    metric=st.selectbox("Sort metric",["confidence","lift","leverage"])
    basket=users_df["FlavourFamilies"].str.get_dummies(sep=",").astype(bool)
    basket=pd.concat([basket,pd.get_dummies(users_df["PurchaseChannel"],prefix="Chan").astype(bool)],axis=1)
    freq=apriori(basket,min_support=sup,use_colnames=True)
    rules=association_rules(freq,metric="confidence",min_threshold=conf)
    if not rules.empty:
        rules=rules.sort_values(metric,ascending=False).head(10); st.dataframe(rules)
        best=rules.iloc[0]
    else:
        st.warning("No rules"); best=None
    with st.expander("Key Insights"):
        if best is not None:
            st.markdown(f"- Top rule: **{{best['antecedents']}}→{{best['consequents']}}**, conf {{best['confidence']:.2f}}.")
        st.markdown("- Uses basket one‑hot across flavours + channel.")
